import React, { useEffect, useState } from 'react';
import { withRouter } from 'react-router-dom';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import * as houseActions from '../actions/houseActions';
import Loader from './Loader';
import HiddenNav from './HiddenNav';
import page from '../styles/Page.module.css';
import { effect } from '../helpers/effects';

const Page = ({ history, match, state, actions, effects, dependencies, children, condition }) => {
  const [items, setItems] = useState(null);

  useEffect(effect.list.bind(actions, history, state), [state, history, actions]);

  //useEffect(effects[1], dependencies[1]);

  return (
    <div className={page.main}
    >
      {
        condition
          ? (
            <>
              { children }
              <HiddenNav />
            </>
          )
          : <Loader />
      }
    </div>
  )
}

function mapStateToProps({ state }) {
  return { state: { ...state } };
}

function mapActionsToProps(dispatch) {
  return {
    actions: bindActionCreators({ ...houseActions }, dispatch),
  };
}

export default connect(mapStateToProps, mapActionsToProps)(withRouter(Page));
